import React from 'react'
import Sessions from './Sessions'
import Calender from './Calender'

function Appointment() {
  const sessionSelection = () => {
    console.log("Hello")
  }
  return (
    <div>
      <div >
        <Sessions onClick={(e) => sessionSelection(e.target.value)} />
      </div>

      <div></div>
    </div>
  )
}

export default Appointment
